import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrap1:{
        marginTop: 80,
        padding: 20,
        fontFamily: "SFUIDisplay-Light",
        fontSize: "20px",
        fontWeight: 300,
        lineHeight: "27px"
    },
    t:{
        color: "#acacac",
        fontSize: 15,
        lineHeight: "27px"
    },
    t1wrap:{
        fontFamily: "SFUIDisplay-Light",
        fontSize: "15px",
        lineHeight: "30px",
        padding: 20
    }
});
export default styles;
